/*Table structure for table `article` */

DROP TABLE IF EXISTS `article`;

CREATE TABLE `article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `article_author` varchar(30) DEFAULT NULL,
  `column_images` varchar(120) DEFAULT NULL,
  `article_content` text,
  `createBy` varchar(255) DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `article_examine_state` varchar(30) DEFAULT NULL,
  `article_hotspot` varchar(30) DEFAULT NULL,
  `article_images` varchar(120) DEFAULT NULL,
  `article_pagedesc` longtext,
  `article_pagekeyword` varchar(200) DEFAULT NULL,
  `article_pagetitle` varchar(200) DEFAULT NULL,
  `article_source` varchar(30) DEFAULT NULL,
  `article_state` varchar(30) DEFAULT NULL,
  `article_summary` longtext,
  `article_title` varchar(200) NOT NULL,
  `updateBy` varchar(255) DEFAULT NULL,
  `updateDate` datetime DEFAULT NULL,
  `article_view_number` int(11) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKD458CCF6F69438EC` (`category_id`),
  CONSTRAINT `FKD458CCF6F69438EC` FOREIGN KEY (`category_id`) REFERENCES `article_category` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `article` */

/*Table structure for table `article_category` */

DROP TABLE IF EXISTS `article_category`;

CREATE TABLE `article_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `category_desc` longtext,
  `icon_url` varchar(160) DEFAULT NULL,
  `like_url` varchar(120) DEFAULT NULL,
  `category_name` varchar(60) NOT NULL,
  `category_sort` int(11) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  `state` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKDBC75627F69438EC` (`category_id`),
  CONSTRAINT `FKDBC75627F69438EC` FOREIGN KEY (`category_id`) REFERENCES `article_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;

